  return {
    props: { ...PRODUCT_DATA },
  };
  

}

const ShopPage = (props) => {
  // const firstAlbums = Object.values(props).slice(0,6);
  // console.log(firstAlbums[0]);

  console.log(props);
  const products = Object.values(props).slice(0, 6); 

  return (
    <div className='shop'>
      {products.map((item) => (
        <div className='item'>
          <h2>{item.productName}</h2>
          <img className="product" src={item.productphotos[0]} alt={item.productName} />
        </div>
      ))}
    </div>
  );
};

export default ShopPage;
